@Bazilis Tak jsem je upozornil na to, že titulek neodpovídá realitě. A už je vyměněný

Hejtman Kuba: Jednání o pomoci krajů afghánským přesídlencům by se měla vést za zavřenými dveřmi

Tohle  je přesně to, co jsme říkal. A tak to máte s titulkama 😉

Neberu politiku osobně, nevyhledávám osobní střety. Politika má být střetem programů a vizí, ne osobním napadáním. 
@SpoluKoalice nabízí voličům odpovědný program, který přinese lidem prosperitu, ne státní bankrot, či odchod z EU a NATO. 
Jsme #SPOLU, změna, které můžete věřit. https://t.co/BHhERaNHv9

Prostě nemůžeme být spokojení s tím, že jsme dostali SKORO všechny spolupracovníky z #Afghanistan! Měli bychom s nimi navázat komunikaci a dostat je do bezpečí. Jsou to lidé, kteří nám pomáhali, nemůžeme se na ně vykašlat!
@metnarl @AndrejBabis @jhamacek 
https://t.co/qaCatzSMp8

Dnes opět inspirováno @MirekTopolanek představujeme další téma @MJureka Chceme zemědělství, které bude vyrábět kvalitní ekologické a zdravé produkty.

Nebudeme lidem říkat, co mají jíst. Nabídneme jim alternativu k chemickým výrobkům a produktům jednoho holdingu 😎

@SpoluKoalice https://t.co/xX9ZjgoJWy

